var KARTE=KARTE||{};KARTE.INPUT={init:function(){this.setParameters(),this.bindEvent()},setParameters:function(){this.$target=$(".jsc-input")},bindEvent:function(){for(var t=this,i=0;i<this.$target.length;i++)t.check(this.$target.eq(i));this.$target.on("keyup",function(){t.check($(this))}),this.$target.on("blur",function(){t.check($(this))})},check:function(t){t.val().length?t.addClass("is-inputted"):t.removeClass("is-inputted")}},KARTE.INPUT.init();